import React from 'react';
import Todo from './Todo/Todo';
import Form from './Form/Multi_input';
import Inc from './Increment/Inc';
import TodoM from './TodoMaterials/Todo';

const App = () =>{
    return(
        <>
        <TodoM/>
        <Inc/>
        <Todo/>
        <Form/>
        </>
    );
};
export default App;
